import {React, useState} from 'react'
import '../styles/Navbar.css'
import { Link } from 'react-router-dom'
import logo from '../assets/GWC_Final-Logo_Teal.png'; // Adjust the path as needed

const Navbar = () => {
  const [isClicked, setIsClicked] = useState(false);

    const handleClick = () => {
        setIsClicked(!isClicked);
    };

  return (
    <div className='navbar'>
      <Link to="/" className="logo">
        <img src={logo} alt="logo_pic" />
      </Link>
      <div className='links'>
        <Link to="/about" className={`about ${isClicked ? 'clicked' : ''}`}
                onClick={handleClick}>About</Link>
        <Link to="/events" className={`events ${isClicked ? 'clicked' : ''}`}
                onClick={handleClick}>Events</Link>
        <Link to="/people" className={`people ${isClicked ? 'clicked' : ''}`}
                onClick={handleClick}>People</Link>
        <Link to="/resources" className={`resources ${isClicked ? 'clicked' : ''}`}
                onClick={handleClick}>Resources</Link>
        <Link to="/contact" className={`contact ${isClicked ? 'clicked' : ''}`}
                onClick={handleClick}>Contact</Link>
      </div>
    </div>
  )
}

export default Navbar
